import styled from 'styled-components';
import pageArrow from '../../assets/pagearrow.svg';

const Container = styled.ul`
    display: flex
`

const PageItem = styled.li`
    width: 2rem;
    height: 2rem;
    border-radius: 50%;
    color: #3f51b5;
    border: 1px solid rgba(63, 81, 181, 0.5);
    background-color: rgba(63, 81, 181, 0.12);
    cursor: pointer;
    text-align: center;
    line-height: 2rem;
`;

function Pager({total, page, onchange}) {
    return <Container>
        <PageItem>
            <svg class="icon" width="16px" height="16.00px" viewBox="0 0 1024 1024" version="1.1" xmlns="http://www.w3.org/2000/svg"><path fill="#dbdbdb" d="M507.733 764.587c-4.266 0-8.533-1.707-11.093-4.267-6.827-5.973-7.68-17.067-0.853-23.893l439.466-486.4c5.974-6.827 17.067-7.68 23.894-0.854 6.826 5.974 7.68 17.067 0.853 23.894L520.533 758.613c-3.413 4.267-8.533 5.974-12.8 5.974z"  /><path fill="#dbdbdb" d="M507.733 764.587c-4.266 0-9.386-1.707-12.8-5.974l-439.466-486.4c-5.974-6.826-5.974-17.92 0.853-23.893 6.827-5.973 17.92-5.973 23.893 0.853l439.467 486.4c5.973 6.827 5.973 17.92-0.853 23.894-2.56 3.413-6.827 5.12-11.094 5.12z"  /></svg>
        </PageItem>
        <PageItem>1</PageItem>
        <PageItem>2</PageItem>
        <PageItem>3</PageItem>
        <PageItem>4</PageItem>
        <PageItem>{">"}</PageItem>
    </Container>
}

export default Pager;
